import React, { useState, useEffect } from 'react';
const ViewDashboard = () => {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        fetchusers();
    }, []);

    const fetchusers = async () => {
        try {
            const response = await fetch('http://127.0.0.1:8000/dashboard/users/'); 
            if (!response.ok) {
                throw new Error('Failed to fetch users');
            }
            const data = await response.json();
            setUsers(data);
        } catch (error) {
            console.error('Error fetching users:', error);
        }
    };
    console.log('users:', users);
    return (
        <div className="main-content">

        <div className="page-content">
            <div className="container-fluid">

                <div className="row">
                    <div className="col-12">
                        <div className="page-title-box d-sm-flex align-items-center justify-content-between">
                            <h4 className="mb-sm-0 font-size-18">Users</h4>
                        </div>
                    </div>
                </div>

                <div className="row">
            <div className="col-12">
                <div className="card">
                    <div className="card-body">
                        {/* Header Section */}
                        <div className="row mb-2">
                            {/* Search Box */}
                            <div className="col-sm-4">
                                <div className="search-box me-2 mb-2 d-inline-block">
                                    <div className="position-relative">
                                        <input type="text" className="form-control" placeholder="Search..." />
                                        <i className="bx bx-search-alt search-icon"></i>
                                    </div>
                                </div>
                            </div>
                        </div>

                        {/* Table Section */}
                        <div className="table-responsive">
                            <table className="table align-middle table-nowrap table-check">
                                <thead className="table-light">
                                    <tr>
                                    <th className="align-middle">Order ID</th>
                                    <th className="align-middle">User</th>
                                    <th className="align-middle">Product</th>
                                    <th className="align-middle">Ordered Date</th>
                                    <th className="align-middle">Amount</th>
                                    <th className="align-middle">Status</th>
                                    <th className="align-middle">Address</th>

                                    </tr>
                                </thead>
                                <tbody>{users.map(order => (
                                <tr key={user.id}>
                                    
                                    <td><a href="javascript: void(0);" className="text-body fw-bold">#{user.payment.razorpay_order_id}</a></td>
                                    <td>{user.user.username}</td>
                                    <td>{user.product.watch_name}</td>
                                    <td>{user.ordered_date}</td>
                                    <td>${user.payment.amount}</td>
                                    <td>
                                        <span className={`badge badge-pill badge-soft-${user.payment.paid ? 'success' : 'danger'} font-size-12`}>
                                            {user.payment.paid ? 'Paid' : 'Unpaid'}
                                        </span>
                                    </td>
                                    <td>
                                        <p>
                                    {user.user.address.country}//
                                    {user.user.address.city}//
                                    {user.user.address.street_address}//
                                    {user.user.address.zipcode}

                                        </p>
                                    </td>
                                </tr>
                            ))}
                                </tbody>
                            </table>
                        </div>

                        {/* Pagination Section */}
                        <ul className="pagination pagination-rounded justify-content-end mb-2">
                            {/* Pagination Items */}
                        </ul>
                    </div>
                </div>
            </div>
        </div>
        </div> 
    </div>

    
    <footer className="footer">
        <div className="container-fluid">
            <div className="row">
                <div className="col-sm-6">
                    <script>document.write(new Date().getFullYear())</script> © React Dashboard.
                </div>
                <div className="col-sm-6">
                    <div className="text-sm-end d-none d-sm-block">
                        Design & Develop by Sarfas
                    </div>
                </div>
            </div>
        </div>
    </footer>
</div>




    );
};

export default ViewDashboard;
